import React from 'react';        // Importing React
import ReactDOM from 'react-dom';  // Importing ReactDOM to render components
import '../src/styles/index.css';              // Importing the global CSS file for styling
import App from './app';           // Importing the App component
//import reportWebVitals from './reportWebVitals'; // Optional for performance tracking

// ReactDOM.render is used to render your main component (App) into the DOM
ReactDOM.render(
  <React.StrictMode>   {/* StrictMode helps highlight potential problems in your app */}
    <App />            {/* Your main component */}
  </React.StrictMode>,
  document.getElementById('root')  // This will attach the React app to the 'root' div in index.html
);

// Optional: Report web vitals (performance analytics)
//reportWebVitals();
